import React from 'react';
import Styles from './register.css';
import ReactDOMServer from 'react-dom/server';
import { Redirect } from 'react-router-dom';

class Register extends React.Component {
  constructor(props){
    super(props);

    this.state={
      Name: "",
      LastName: "",
      Email: "",
      Pass: "",
      Country: ["Uruguay", "Argentina"],
    };
  };


  render(){
    return (
        <div className="backgroundRegister">
          <div><img class="logoRegister" src={require('../../images/logoBlanco.png')} /></div>
            <div className="containerRegister">
              <form>
                  <div class="form-group NameRegister">
                    <input  value={this.state.Name} onChange={(event) => {this.setState({Name: event.target.value});}} type="text" class="form-control NameRegisterInput" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="First name"/>
                  </div>
                  <div class="form-group LastNameRegister">
                    <input value={this.state.LastName} onChange={(event) => {this.setState({LastName: event.target.value});}} type="text" class="form-control LastNameRegisterInput" id="exampleInputPassword1" placeholder="Last name"/>
                  </div>
                  <div class="form-group EmailRegister">
                    <input value={this.state.LastName} onChange={(event) => {this.setState({LastName: event.target.value});}} type="Email" class="form-control EmailRegisterInput" id="exampleInputPassword1" placeholder="Email"/>
                  </div>
                  <div class="form-group PassRegisterInput">
                    <input value={this.state.LastName} onChange={(event) => {this.setState({LastName: event.target.value});}} type="password" class="form-control PassRegisterInput" id="exampleInputPassword1" placeholder="Password"/>
                  </div>
                  <div class="form-group CountryRegisterInput">
                    <input value={this.state.LastName} onChange={(event) => {this.setState({LastName: event.target.value});}} type="password" class="form-control CountryRegisterInput" id="exampleInputPassword1" placeholder="Country"/>
                  </div>
              </form>
            </div>
        </div>
    );
  }
}



export default Register;
